          <SearchBar />
        </div>
      </div>

        <Link to='/ticket'>COMPRAAAA</Link>
        <Link to='./Maps.js'>MAPAAAAA</Link>

      <div className="containerInfos">
        <div className="infos">
          <img src={Money} className="imgInf"></img>
